import React, { Component } from "react";
import "./Login.scss";

class Login extends Component {
  render() {
    return (
      <div className={this.state.isLogin ? "loginModal" : "loginModalHide"}>
        <div className="modal">
          <h2>로그인창</h2>.
        </div>

        <div className="modalLayer" onClick={this.handleClose}></div>
      </div>
    );
  }
}

export default Login;
